import React from 'react'

const DisplayColors = () => (
  ["red", "orange", "green", "blue", "purple"].map((color, index) => {
    return (
      <div
        key={index}
        className={`select-color ${color}-title`}>
      </div>
    )
  })
)

export default DisplayColors
